import React from 'react';
// import logo from './logo.svg';
import './App.css';
import Body from './one/body';
import Header from './common/header';
import Footer from './common/footer';

function App() {
  return (
    <div className="App">
      <Header/>

      <Body name="Santosh" mobile="8121521234567895304"/>
      <Footer/>
    </div>
  );
}

export default App;
